import React from "react";
import { Link } from "react-router-dom";

export default function Card({ id, name, species, gender, image, onClose }) {
   return (
      <div>
         <button onClick={() => onClose(id)}>X</button>
         <Link to={`/detail/${id}`}>
            <p>{name}</p>
         </Link>
         <p>{species}</p>
         <p>{gender}</p>
         <img src={image} alt='' />
      </div>
   );
}
